import React from 'react';

const PrintStar = (max) => {
  for (let i=0; i<max; i++) {
    let str=""; // 매 행마다 초기화
    for (let j=0; j<i+1; j++) {
        str += "*";
    }
    console.log(str);
  }
  return (
    <div>PrintStar</div>
  );
};

export default PrintStar;
